import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
      <page class="page">
         <section class="header">
            <div class="header__logo">
               <img src="<%=require('./images/__graphics/graphics__logo.png')%>" class="header__vector" alt="Лого" />
            </div>
         </section>

      </page>
    </>
  );
}

export default App;
